use Symfony\Bundle\FrameworkBundle\Tests\TestCase;

class ZmfPayApiTest extends TestCase
{


    public function testHadProduct() {
        $api = $this->getApiInstance();
        $req = new ZmfProductQueryReq();
        $req->setCustomerOutNo('888888888');
        $ret = $api->queryProduct($req);
        $this->assertTrue($ret->isSuccess(), $ret->getMsg());
    }

    public function testBankQuery() {
        $api = $this->getApiInstance();
        $req = new ZmfCustomerBankQueryReq();
        $req->setCustomerOutNo('1');
        $ret = $api->queryCustomerBank($req);
        $this->assertTrue($ret->isSuccess(), $ret->getMsg());
    }

