    public function test4F() {

        $api = $this->getApiInstance();
        $req = new ZmfFourFactorsAuthReq();
        $req->setAcctNo('6228481268248914675');
        $req->setCerdId('330328199208120957');
        $req->setCustomerName('');
        $req->setPhoneNo('13484379291');
        $req->setProductCode(ZmfProductCode::FourElement);
        $req->setCustomerOutNo('SYS01');
        $ret = $api->authFourFactors($req);
        var_dump($ret);
        $this->assertTrue($ret->isFail(), $ret->getMsg());
    }

    public function testQueryBankBranch()
    {
        $api = $this->getApiInstance();
        $req = new ZmfBankBranchQueryReq();
        $req->setKeyword('');
        $req->setCardNo('6228481268248914675');
        $ret = $api->queryBankBranch($req);
        $this->assertNotNull($ret);
        $this->assertInstanceOf(CallResult::class, ($ret));
        $this->assertTrue($ret->isSuccess(), $ret->getMsg());
    }

    protected function getApiInstance() {
        return new ZmfPayApi(new ZmfDevConfig());
    }

